      'body' => array(
        'und' => array(
          array(
            'value' => "<h2>Fill coordinates from literature</h2>\r\n\r\n<p>I have seen in ATeL <a href=\"https://www.astronomerstelegram.org/?read=14588\">#14588</a> and <a href=\"https://www.astronomerstelegram.org/?read=14589\" target=\"_blank\">#14589</a> we see that a source is detected at coordinates R.A. = 270.80 deg Dec = <strong>-</strong>29.80 deg.</p>\r\n\r\n<p>We want to check if there are INTEGRAL results from 1 to 5 May 2021, so we insert these coordinate and the start and end time in the source query (the object name is not relevant here).</p>\r\n\r\n<p><a class=\"colorbox colorbox-insert-image\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-isgri/query1.png\"><img alt=\"\" class=\"image-large\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-isgri/query1.png?itok=pIt8_uSO\" style=\"height:157px; width:480px\" /> </a></p>\r\n\r\n<p>We want to see if the source is detected in IBIS ISGRI, so we click on ISGRI tab and proceed.</p>\r\n\r\n<h2>ISGRI image request (parameters)</h2>\r\n\r\n<p><a class=\"colorbox colorbox-insert-image\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-isgri/isgri-query1.png\"><img alt=\"\" class=\"image-large\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-isgri/isgri-query1.png?itok=4p79x6oT\" style=\"height:480px; width:256px\" /> </a></p>\r\n\r\n<p>We first coose OSA 11.0, as data are after January 2016.</p>\r\n\r\n<p>Then we have a search radius of 10 degrees to exploit the ISGRI field of view with limited artifacts.</p>\r\n\r\n<p>We selected science windows from time range</p>\r\n\r\n<p>We analyze at most 50 science windows : with login, we can choose up to 500.</p>\r\n\r\n<p>Note that some data are private if one year has not passed since their distribution, so we select \"All private\". This is a serendipitous source, so data rights are not reserved. However, the user must comply with the <a href=\"https://www.isdc.unige.ch/integral/archive#NRT_CONS_data\" target=\"_blank\">terms and condition</a> of use and this will be possible only after approval of login ! For public data, login is not necessary, but encourages.</p>\r\n\r\n<p>We then select a suitable energy range: here for discovery 28-40 keV is a good practice in our experience. Note that at the beginning of the mission, down to 20 keV could be selected.</p>\r\n\r\n<p>Detection threshold can be left to 5 or raised, we discourage anything below 5.</p>\r\n\r\n<p>Be sure that \"image\" is selected and hit \"submit button. Soon after you will see a progress windows and will receive an email.</p>\r\n\r\n<p><a class=\"colorbox colorbox-insert-image\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-isgri/rprogress-image.png\"><img alt=\"\" class=\"image-large\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-isgri/rprogress-image.png?itok=zWLSukny\" style=\"height:356px; width:480px\" /> </a></p>\r\n\r\n<p><a class=\"colorbox colorbox-insert-image\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-isgri/email.png\"><img alt=\"\" class=\"image-large\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-isgri/email.png?itok=hFlhiLSA\" style=\"height:256px; width:480px\" /> </a></p>\r\n\r\n<p>Note that the email is received only with a login ! At this point, you can close the browser window and wait for a second email that will be sent when the product is ready. Three important points in the email:</p>\r\n\r\n<ul class=\"rteindent1\">\r\n\t<li>the url link allows you to inspect the status of your request at any time or retrieve the data when finished.</li>\r\n\t<li>in case of issues you can contact us</li>\r\n\t<li>if you are familiar with python, you can get the products also in a jupyter noteboon using the code snippet at the end of the email (not shown here).</li>\r\n</ul>\r\n\r\n<h1>Image and catalog inspection</h1>\r\n\r\n<p>You will be able to see the image with a new source. You can check its coordinates by looking at the catalog (click on catalog). You will see that there are two new sources in this case. This is because one is detected in the mosaicked image and one possibly in a science window. You can delete one from the catalog by selecting it and clicking on delete. You can click then on \"use catalog\" to use this new catalog in spectrum extraction or light curve extraction.</p>\r\n\r\n<p><a class=\"colorbox colorbox-insert-image\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-isgri/image.png\"><img alt=\"\" class=\"image-large\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-isgri/image.png?itok=x_s-3Gde\" style=\"height:415px; width:480px\" /> </a></p>\r\n\r\n<p><a class=\"colorbox colorbox-insert-image\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-isgri/catalog.png\"><img alt=\"\" class=\"image-large\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-isgri/catalog.png?itok=GMp8EoAJ\" style=\"height:342px; width:480px\" /> </a></p>\r\n\r\n<p>Nothe that if you click on \"js9\" yoou can see the image with coordinates, but it is not currently possible to visualize regions. To do that, you can save the catalog in a text format and convert it in <a href=\"http://ds9 region file,\" target=\"_blank\">ds9 region file</a> and load it. Or you can download the image and do it locally.</p>\r\n\r\n<p>This command ican be used to convert the catalog.txt text file to a ds9 region file to be loaded by js9 (In this example edit the catalog.txt to change NEW_1 into NEW 1 )</p>\r\n\r\n<p><span style=\"font-family:Courier New,Courier,monospace\">echo \"FK5\" &gt; region.reg;awk '{print \"circle(\"$5 \"d, \" $6 \"d, 0.5d) {\\\"text\\\" : \\\"\"$2 $3 \"\\\"}\" }' catalog.txt &gt;&gt; region.reg</span></p>\r\n\r\n<p><a class=\"colorbox colorbox-insert-image\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-isgri/js9.png\"><img alt=\"\" class=\"image-large\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-isgri/js9.png?itok=0CDfVxkV\" style=\"height:480px; width:416px\" /> </a></p>\r\n\r\n<p>This thread can be reproduced using <a href=\"https://frontend.staging.odahub.io/cdci/mmoda/?src_name=4U+1700-377&amp;RA=270.80&amp;DEC=-29.80&amp;T1=2021-05-01&amp;T2=2021-05-05&amp;T_format=isot&amp;instrument=isgri&amp;osa_version=OSA11.0&amp;radius=10&amp;use_scws=no&amp;max_pointings=50&amp;integral_data_rights=all-private&amp;E1_keV=28&amp;E2_keV=40&amp;query_type=Real&amp;detection_threshold=5&amp;product_type=isgri_image&amp;query_status=new\" target=\"_blank\">this url</a>.</p>\r\n\r\n<address>Go to the main <a href=\"astrooda\">Astrooda Help</a></address>\r\n",
            'summary' => '',
            'format' => 'full_html',
            'safe_value' => "<h2>Fill coordinates from literature</h2>\n\n<p>I have seen in ATeL <a href=\"https://www.astronomerstelegram.org/?read=14588\">#14588</a> and <a href=\"https://www.astronomerstelegram.org/?read=14589\" target=\"_blank\">#14589</a> we see that a source is detected at coordinates R.A. = 270.80 deg Dec = <strong>-</strong>29.80 deg.</p>\n\n<p>We want to check if there are INTEGRAL results from 1 to 5 May 2021, so we insert these coordinate and the start and end time in the source query (the object name is not relevant here).</p>\n\n<p><a class=\"colorbox colorbox-insert-image\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-isgri/query1.png\"><img alt=\"\" class=\"image-large\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-isgri/query1.png?itok=pIt8_uSO\" style=\"height:157px; width:480px\" /> </a></p>\n\n<p>We want to see if the source is detected in IBIS ISGRI, so we click on ISGRI tab and proceed.</p>\n\n<h2>ISGRI image request (parameters)</h2>\n\n<p><a class=\"colorbox colorbox-insert-image\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-isgri/isgri-query1.png\"><img alt=\"\" class=\"image-large\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-isgri/isgri-query1.png?itok=4p79x6oT\" style=\"height:480px; width:256px\" /> </a></p>\n\n<p>We first coose OSA 11.0, as data are after January 2016.</p>\n\n<p>Then we have a search radius of 10 degrees to exploit the ISGRI field of view with limited artifacts.</p>\n\n<p>We selected science windows from time range</p>\n\n<p>We analyze at most 50 science windows : with login, we can choose up to 500.</p>\n\n<p>Note that some data are private if one year has not passed since their distribution, so we select \"All private\". This is a serendipitous source, so data rights are not reserved. However, the user must comply with the <a href=\"https://www.isdc.unige.ch/integral/archive#NRT_CONS_data\" target=\"_blank\">terms and condition</a> of use and this will be possible only after approval of login ! For public data, login is not necessary, but encourages.</p>\n\n<p>We then select a suitable energy range: here for discovery 28-40 keV is a good practice in our experience. Note that at the beginning of the mission, down to 20 keV could be selected.</p>\n\n<p>Detection threshold can be left to 5 or raised, we discourage anything below 5.</p>\n\n<p>Be sure that \"image\" is selected and hit \"submit button. Soon after you will see a progress windows and will receive an email.</p>\n\n<p><a class=\"colorbox colorbox-insert-image\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-isgri/rprogress-image.png\"><img alt=\"\" class=\"image-large\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-isgri/rprogress-image.png?itok=zWLSukny\" style=\"height:356px; width:480px\" /> </a></p>\n\n<p><a class=\"colorbox colorbox-insert-image\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-isgri/email.png\"><img alt=\"\" class=\"image-large\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-isgri/email.png?itok=hFlhiLSA\" style=\"height:256px; width:480px\" /> </a></p>\n\n<p>Note that the email is received only with a login ! At this point, you can close the browser window and wait for a second email that will be sent when the product is ready. Three important points in the email:</p>\n\n<ul class=\"rteindent1\">\n\t<li>the url link allows you to inspect the status of your request at any time or retrieve the data when finished.</li>\n\t<li>in case of issues you can contact us</li>\n\t<li>if you are familiar with python, you can get the products also in a jupyter noteboon using the code snippet at the end of the email (not shown here).</li>\n</ul>\n\n<h1>Image and catalog inspection</h1>\n\n<p>You will be able to see the image with a new source. You can check its coordinates by looking at the catalog (click on catalog). You will see that there are two new sources in this case. This is because one is detected in the mosaicked image and one possibly in a science window. You can delete one from the catalog by selecting it and clicking on delete. You can click then on \"use catalog\" to use this new catalog in spectrum extraction or light curve extraction.</p>\n\n<p><a class=\"colorbox colorbox-insert-image\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-isgri/image.png\"><img alt=\"\" class=\"image-large\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-isgri/image.png?itok=x_s-3Gde\" style=\"height:415px; width:480px\" /> </a></p>\n\n<p><a class=\"colorbox colorbox-insert-image\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-isgri/catalog.png\"><img alt=\"\" class=\"image-large\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-isgri/catalog.png?itok=GMp8EoAJ\" style=\"height:342px; width:480px\" /> </a></p>\n\n<p>Nothe that if you click on \"js9\" yoou can see the image with coordinates, but it is not currently possible to visualize regions. To do that, you can save the catalog in a text format and convert it in <a href=\"http://ds9 region file,\" target=\"_blank\">ds9 region file</a> and load it. Or you can download the image and do it locally.</p>\n\n<p>This command ican be used to convert the catalog.txt text file to a ds9 region file to be loaded by js9 (In this example edit the catalog.txt to change NEW_1 into NEW 1 )</p>\n\n<p><span style=\"font-family:Courier New,Courier,monospace\">echo \"FK5\" &gt; region.reg;awk '{print \"circle(\"$5 \"d, \" $6 \"d, 0.5d) {\\\"text\\\" : \\\"\"$2 $3 \"\\\"}\" }' catalog.txt &gt;&gt; region.reg</span></p>\n\n<p><a class=\"colorbox colorbox-insert-image\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-isgri/js9.png\"><img alt=\"\" class=\"image-large\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-isgri/js9.png?itok=0CDfVxkV\" style=\"height:480px; width:416px\" /> </a></p>\n\n<p>This thread can be reproduced using <a href=\"https://frontend.staging.odahub.io/cdci/mmoda/?src_name=4U+1700-377&amp;RA=270.80&amp;DEC=-29.80&amp;T1=2021-05-01&amp;T2=2021-05-05&amp;T_format=isot&amp;instrument=isgri&amp;osa_version=OSA11.0&amp;radius=10&amp;use_scws=no&amp;max_pointings=50&amp;integral_data_rights=all-private&amp;E1_keV=28&amp;E2_keV=40&amp;query_type=Real&amp;detection_threshold=5&amp;product_type=isgri_image&amp;query_status=new\" target=\"_blank\">this url</a>.</p>\n\n<address>Go to the main <a href=\"astrooda\">Astrooda Help</a></address>\n",
